import './css/App.css';
import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import Navbar from './components/Navbar.js';

const App = () => {
  return (
    <Router>
      <div className="App">
        <Navbar/>
      </div>
    </Router>
  );
};

export default App;
